export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on the profile modal button
    await page.waitForSelector('.profile-btn');
    await page.click('.profile-btn');
    await page.waitForSelector('#profileModal');

    // Take screenshot after opening profile modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_modal_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_modal_opened.png'));

    // Click on the settings button within the profile modal
    await page.waitForSelector('.settings-btn');
    await page.click('.settings-btn');
    await page.waitForSelector('#settingsModal');

    // Take screenshot after opening settings modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_settings_modal_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_settings_modal_opened.png'));

    // Toggle the notification setting
    await page.waitForSelector('#notificationsToggle');
    const toggleStatusBefore = await page.isChecked('#notificationsToggle');
    await page.click('#notificationsToggle');
    const toggleStatusAfter = await page.isChecked('#notificationsToggle');

    // Take screenshot after toggling notification setting
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_notification_toggled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_notification_toggled.png'));

    // Verify toggle status
    const notificationStatus = toggleStatusBefore !== toggleStatusAfter ? "Toggled" : "Not Toggled";

    return {
      success: true,
      action: `Successfully toggled notification setting: ${notificationStatus}`,
      extractedData: {
        notificationToggled: notificationStatus
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
